function upload(){var n=document.getElementById("selector");n.onchange=()=>{n.value!=undefined&&n.value!=null&&n.value!=""&&document.getElementById("submit").click()};n.click()}function fromUrl(n){var i=document.getElementById("currentUrl").value,t=prompt("请输入url",i);t!=null&&t!=""&&(window.location.href="/Admin/Bgm/SetBgmType?bgmType="+n+"&url="+t)}function play(n){var t="/Admin/Bgm/Play?musicName="+n;document.getElementById("player").src=t}